// https://jsonplaceholder.typicode.com/todos
 import{useEffect} from "react";



function Data(){
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/todo")
    })
    .then((res)=>{
        return res.json()
    })
    .then((resp)=>{
        console.log(resp)

    })
    return(
        <div>
          <h1>Hook's Method</h1>
        </div>
    )
}
export default Data;
